\f0\fs36 \cf0 Each time the class meets, it begins with a review of the student work done that week. Maybe there isn't time to go through all of the submissions, but some of the interesting ones have been picked out. The class critiques the work together, asking the author about what they find interesting or unclear in the code. In this way, the whole class learns what makes code easy or hard to understand. Maybe a student got most of the assignment working, but wasn't able to get everything working perfectly. Instead of simply handing the student a low grade, the instructor can bring up the work for the whole class to debug together, until it works, and everyone has learned something. When the students go off to do the assignments, they know their work might be on the big screen next week. So they try hard to make it look good. The students are encouraged to talk about the assignments and work on them together. They don't have to be isolated by strict rules to prevent plagiarism, because they have to be prepared to defend their work to the class.\
